"""User routes generated by ANG."""

from __future__ import annotations

from typing import Any

from fastapi import APIRouter, Depends

from app.services.user import UserService, get_user_service

router = APIRouter(tags=["User"])

@router.get("/users/{id}")
async def get_user(id: str, svc: UserService = Depends(get_user_service)) -> Any:
    return await svc.get_user(id)

@router.post("/users")
async def get_user_post(payload: dict[str, Any], svc: UserService = Depends(get_user_service)) -> Any:
    return await svc.get_user_post(payload)
